		}

		protected override void OnPopulateMesh(VertexHelper toFill) {
			toFill.Clear();

			var vert = UIVertex.simpleVert;
			vert.color = color;

			var pos = GetPixelAdjustedRect();
			var halfSize = new Vector3(pos.width * 0.5f, pos.height * 0.5f, pos.width * 0.5f);
			var uvVector4 = ((overrideSprite != null)? UnityEngine.Sprites.DataUtility.GetOuterUV(overrideSprite): Vector4.zero);
			var uv = new Rect(uvVector4.x, uvVector4.y, uvVector4.z - uvVector4.x, uvVector4.w - uvVector4.y);

			var verts = Enumerable.Range(0, c_Vertices.GetLength(0))
								.Select(x=>{
									var positionIndex = c_Vertices[x, 0];
									vert.position = Vector3.Scale(c_Positions[positionIndex], halfSize);
									var uvIndex = c_Vertices[x, 1];
									vert.uv0 = Vector2.Scale(c_Uvs[uvIndex], uv.size) + uv.min;
									return vert;
								})
								.ToList();
			toFill.AddUIVertexStream(verts, c_Indicies);
		}

		public override bool IsRaycastLocationValid(Vector2 screenPoint, Camera eventCamera) {
			//Detail collision is not implemented
			return true;
		}

